import React from 'react';

function Header() {
  return (
    <header>
      <div className="container">
        <div className="header-content">
          <div className="logo">LLMs.txt Generator</div>
          <div className="header-right">
            <span>Modern Web Scraping Tool</span>
          </div>
        </div>
      </div>
    </header>
  );
}

export default Header;
